import React from "react";
import {CardFooter} from "reactstrap";
import ButtonUi from "../../../../components/buttons/buttonUi";

const FooterComponent = props => {

    return (
        <CardFooter>
            <ButtonUi
                className='pull-right'
                label={'Send'}
            />
        </CardFooter>
    )
}

export default FooterComponent
